sys_variable_value.value:
(function execute(inputs, outputs) {
  outputs.status = inputs.status_code
  outputs.response_body = inputs.response

  if (inputs.status_code !== 200 && inputs.status_code !== 201) {
    var responseBody = JSON.parse(inputs.response)
    var errorMessage = "Status Code: " + inputs.status_code + " "
  	errorMessage += inputs.response
    gs.error(errorMessage)

    outputs.error_message = responseBody.message
    outputs.error_map = responseBody.errorMap
    outputs.request_body_sent = inputs.request_body
  } 
})(inputs, outputs);

