sys_variable_value.value:
(function execute(inputs, outputs) {
  var content = inputs.request_body;
  var base_url = gs.getProperty("x_g_dis_atat.aws.hoth.baseUrl");

  var httpRequestData = new sn_auth.HttpRequestData();
  // The endpoint needs to be the full URL for the resource path in order to properly
  // create the Canonical Request string.
  httpRequestData.setEndpoint(base_url + inputs.resource_path);
  httpRequestData.setService('execute-api');
  httpRequestData.setRegion(gs.getProperty("x_g_dis_atat.aws.region"));
  httpRequestData.setHttpMethod('POST');
  httpRequestData.setDirective('header');
  httpRequestData.addHeader('Content-Type', 'application/json');
  httpRequestData.setContent(content);

  // The `getAuthCredentialByID` method is referenced in the documentation for
  // the other classes used in this script; however, that function does not seem
  // to be documented itself; however, it does return an AuthCredential object
  // which is required in order to perform the signing.
  var credential = new sn_cc.StandardCredentialsProvider().getAuthCredentialByID(gs.getProperty("x_g_dis_atat.aws.credential.sys_id"));
  var signingApi = new sn_auth.RequestAuthAPI(httpRequestData, credential);
  var signedRequest = signingApi.generateAuth();

  // Because the content is not transformed as part of this action, we don't
  // output it and we can just re-use the input in future requests. We do output
  // the headers that contain the necessary information for the AWS service to
  // accept the request.



  var headers = signedRequest.getHeaderMap();
  outputs.base_url = base_url;
  outputs.host_header = gs.getProperty("x_g_dis_atat.aws.hoth.baseUrl");
  outputs.authorization_header = headers['Authorization'];
  outputs.date_header = headers['X-Amz-Date'];
  outputs.request_body_to_send = content;
  outputs.api_gateway_id = gs.getProperty("x_g_dis_atat.aws.hoth.apiGatewayId");
})(inputs, outputs);

